.model COMPACT
;///////////////////////////////Macros////////////////////////////////////
delay macro duration
	      local lp
	      push  cx
	      mov   cx, duration
	lp:   loop  lp
	      pop   cx

endm
clearWholeScreen MACRO
	                 mov ah, 0
	                 mov al, 3
	                 INT 10H  	;FOR VIDEO DISPLAY
	ENDM
inputToMoveShip macro UP, DOWN, LEFT, RIGHT, FIRE_BTN, movShip1_label; pass the keys and the label to jump to
	                cmp ah,UP
	                jz  movShip1_label

	                cmp ah,DOWN
	                jz  movShip1_label

	                cmp ah,LEFT
	                jz  movShip1_label

	                cmp ah,RIGHT
	                jz  movShip1_label

	                cmp ah, FIRE_BTN
	                jz  movShip1_label
ENDM
