name ENDS
.code
MAIN PROC FAR
	                              mov              AX,@data                                                                             	;initializing the data segemnt
	                              mov              DS,AX
	;///////////////////////////////First Screen////////////////////////////////////

	firstScreenLoop:              
	                              mov              ax, graphicsModeAX                                                                   	; enter graphicsMode
	                              mov              bx, graphicsModeBX                                                                   	; BX = 81FFh
	                              int              10h

	                              mov              ah,09h
	                              lea              dx, firstScreen                                                                      	; show the first screen
	                              int              21h

	                              mov              ah,09h
	                              lea              dx, getName                                                                          	; ask for player's name
	                              int              21h

	getNameLoop:                  lea              si, playerName1                                                                      	; get player's name
	                              mov              ah, 0Ah
	                              mov              dx, si
	                              int              21h

	; TODO check of the name is valid
	; mov bp, offset playerName1 + 1
	; or           [bp], 0
	; jnz            mainMenuLoop

	; mov            ah,09h
	; lea            dx, enterValidName      	; ask for a valid player's name
	; int            21h
	; jmp            getNameLoop
	;///////////////////////////////Main Menu////////////////////////////////////
	mainMenuLoop:                 
	                              clearWholeScreen
	                              mov              ax, graphicsModeAX                                                                   	; enter graphicsMode
	                              mov              bx, graphicsModeBX                                                                   	; BX = 81FFh
	                              int              10h
	;call             background
	                              call             drawgamebtn
	                              call             drawchatbtn
	                              call             drawexitbtn
	                              call             drawArrows
	                              call             drawLogo

	CheckInMainMenu:              
	                              mov              ah,0                                                                                 	;  ah:al = scan code: ASCII code
	                              int              16h

	                              cmp              ah, key_upArrow                                                                      	; up arrow
	                              jne              downArrow_label
	                              cmp              arrowoffsetY, arrowAtgame
	                              je               CheckInMainMenu
	                              call             eraseArrows
	                              mov              bx, arrowStep
	                              SUB              arrowoffsetY, bx
	                              call             drawArrows
	                              jmp              CheckInMainMenu

	downArrow_label:              cmp              ah, key_downArrow                                                                    	; down arrow
	                              jne              enterKey_label
	                              cmp              arrowoffsetY, arrowAtExit
	                              je               CheckInMainMenu
	                              call             eraseArrows

	                              mov              bx, arrowStep
	                              ADD              arrowoffsetY, bx
	                              call             drawArrows

	                              jmp              CheckInMainMenu

	enterKey_label:               cmp              ah, key_enter                                                                        	; enter
	                              jne              CheckInMainMenu                                                                      	; added to prevent other buttons from doing enter's action
	                              cmp              arrowoffsetY, arrowAtExit
	                              je               exitProg
	                              cmp              arrowoffsetY, arrowAtChat
	;je gameLoop
	                              cmp              arrowoffsetY, arrowAtgame
	                              je               gameLoop
	                              jmp              CheckInMainMenu
	;///////////////////////////////Game Loop////////////////////////////////////
	gameLoop:                                                                                                                           	;NOTE:since we are using words, we will use the value '2' to traverse pixels
	;//////////////////////////////initializations////////////////////////////////////
	                              mov              ax, graphicsModeAX
	                              mov              bx, graphicsModeBX
	                              int              10h
	                              call             drawShip1
	                              call             Drawship2                                                                            	;this subroutine is responsible for drawing the ship using its cooardinates
	;////////////////////////////Interacting with the user////////////////////////////
	gameLoopRoutine:              
	                              call             updateBullets

	;////////////////////////////////////check for user input/////////////////////////////////////////////
	                              mov              ah,1
	                              int              16h
	                              jz               gameLoopRoutine                                                                      	; check if there is any input

	                              inputToMoveShip  key_w, key_s, key_a, key_d, key_f, moveShip1_label
	                              inputToMoveShip  key_upArrow, key_downArrow, key_leftArrow, key_rightArrow, key_enter, moveShip2_label
	                             
	moveShip1_label:              
	                              call             movShip1
	                              jmp              gameLoopRoutine
	moveShip2_label:              
	                              CALL             movShip2                                                                             	; TO GENERATE THE new OFFSET OF THE ship
	                              jmp              gameLoopRoutine
	;/////////////////////////////////////////////////////////////////////////////////
	;///////////////////////////////Exit Program/////////////////////////////////////
	exitProg:                     
	                              clearWholeScreen
	                              mov              ah,09h
	                              lea              dx, byebye                                                                           	; show the bye bye screen
	                              int              21h

	                              mov              ah,4ch
	                              int              21h
MAIN ENDP
	;//////////////////////////////Procedures//////////////////////////////////////////////
movShip1 PROC near

	                              cmp              al,key_esc                                                                           	; ESC
	                              jz               exitProg
	                              cmp              ah, 21H
	                              jz               movShip1_donotErase
	                              call             eraseShip1                                                                           	; get the pressed key from the user

	movShip1_donotErase:          cmp              ah,key_w
	                              jz               movShip1_moveUp

	                              cmp              ah,key_s
	                              jz               movShip1_moveDown

	                              cmp              ah,key_a
	                              jz               movShip1_moveLeft

	                              cmp              ah,key_d
	                              jz               movShip1_moveRight

	                              cmp              ah, key_f
	                              jz               movShip1_fire


	movShip1_readKey:             
	                              call             drawShip1

	                              mov              ah,0                                                                                 	;wait for a key to be pressed and put it in ah, ah:al = scan code: ASCII code
	                              int              16h

	                              mov              cx, 0                                                                                	; initialize cx to use it to iterate over the shipSize
	                              jmp              gameLoopRoutine


	movShip1_readFire:            

	                              mov              ah,0                                                                                 	;wait for a key to be pressed and put it in ah, ah:al = scan code: ASCII code
	                              int              16h

	                              mov              cx, 0                                                                                	; initialize cx to use it to iterate over the Bullet Size
	                              jmp              gameLoopRoutine
	;///////////////////////////////////////////////////////////////////////////////////////
	movShip1_moveUp:              
	;checking for boundaries
	                              mov              bx, shipOffsetY1
	                              cmp              bx, screenMinY1
	                              jna              movShip1_readKey
	                              sub              bx, shipSpeed1
	                              mov              DI, offset shipOffsetY1
	                              mov              [DI], bx

	                              jmp              movShip1_readKey

	movShip1_moveDown:            
	;checking for boundaries
	                              mov              bx, shipOffsetY1
	                              mov              cx, bx
	                              add              cx, shipSizeY1
	                              cmp              cx, screenMaxY1
	                              jnb              movShip1_readKey
	                              add              bx,shipSpeed1
	                              mov              DI, offset shipOffsetY1
	                              mov              [DI], bx

	                              jmp              movShip1_readKey

	movShip1_moveLeft:            
	;checking for boundaries
	                              mov              bx, shipOffsetX1
	                              cmp              bx, screenMinX1
	                              jna              movShip1_readKey
	                              sub              bx, shipSpeed1
	                              mov              DI, offset shipOffsetX1
	                              mov              [DI], bx
	          
	                              jmp              movShip1_readKey

	movShip1_moveRight:           
	;checking for boundaries
	                              mov              bx, shipOffsetX1
	                              mov              cx, bx
	                              add              cx, shipSizeX1
	                              cmp              cx, screenMaxX1
	                              jnb              movShip1_readKey
	                              add              bx, shipSpeed1
	                              mov              DI, offset shipOffsetX1
	                              mov              [DI], bx

	                              jmp              movShip1_readKey


	movShip1_fire:                
	                              mov              bx, 0
	                              LEA              SI, BulletDirection
	movShip1_findEmptyBullet:     MOV              DL, 0
	                              CMP              [SI], DL
	                              JE               movShip1_found
	                              CMP              BX, MAXBULLET
	                              JE               movShip1_notFound
	                              INC              BX
	                              INC              SI
	                              JMP              movShip1_findEmptyBullet
    
	movShip1_notFound:            ret

	movShip1_found:               mov              dl, 1
	                              mov              [SI], dl                                                                             	; For Right Direction
	                              LEA              DI, BulletOffset
	                              ADD              DI, BX
	                              ADD              DI, BX
	                              ADD              DI, BX
	                              ADD              DI, BX

	; For x
                    
	                              mov              dX, shipOffsetX1
	                              add              DX, shipSizeX1
	                              INC              DX
	                              MOV              [DI], DX
                
	; For y

	                              mov              dx, shipSizeY1
	                              sub              dx, BulletYSize

	; These steps for division
	; First push ax to stack as we need it after that
	                              push             ax

	; Divsion Process
	                              mov              ax, dx
	                              mov              cl, 2
	                              div              cl
	                              mov              dx, ax

	; retrive the value of reg ax
	                              pop              ax
	                              add              dx, shipOffsetY1

	                              mov              [DI] + 2, dx
	                              jmp              movShip1_readFire

	                      
	                              ret

movShip1 ENDP
movShip2 PROC near
