	                              DEC              DX                                                                                   	;  loop iteration in y direction
	                              JZ               drawArrows_allDrawnR                                                                 	;  both x and y reached 00 so finish drawing
	                              jmp              drawArrows_drawItR
	drawArrows_allDrawnR:         ret
drawArrows ENDP
